class Solution {
  int maximumStrongPairXor(List<int> nums) {
    int maxXor = 0;
    nums.sort();
    for (int i = 0; i < nums.length; i++) {
      for (int j = i; j < nums.length; j++) {
        if ((nums[j] - nums[i]) <= nums[i]) {
          maxXor = max(maxXor, nums[i] ^ nums[j]);
        }
      }
    }
    return maxXor;
  }

  int max(int a, int b) => (a > b) ? a : b;
}
